import React from 'react'
import './App.css';
import HomeInfo from './HomeInfo';
import AboutSection from './AboutSection';
import Testimonalsection from './Testimonalsection';
import DateCurrent from './DateCurrent';

function Home(){
    return(
        <div>
           <HomeInfo />
           <AboutSection />
           <Testimonalsection />
           <DateCurrent />
        </div>
    );
}

export default Home
